import React from 'react';

const EventCard = ({ event }) => {
  return (
    <div className="flex border-b py-4">
      {/* Date Box */}
      <div className="w-1/6 flex flex-col items-center bg-black text-white py-4">
        <span className="text-4xl font-bold">{event.date}</span>
        <span className="text-xl uppercase">{event.month}</span>
      </div>

      {/* Event Details */}
      <div className="w-4/6 px-4 flex flex-col justify-center">
        <div className="text-lg font-semibold">{event.eventName}</div>
        <div className="text-sm">Hosted by {event.host}</div>
        <div className="text-sm text-gray-500">{event.location}</div>
        <div className="text-sm mt-2">{event.date} - {event.endDate}</div>
        <div className="text-sm">{event.time}</div>
      </div>

      {/* View Event Box */}
      <div className="w-1/6 flex flex-col items-center justify-center bg-black text-white">
        <div className="text-sm">{event.cost}</div>
        <button className="bg-gray-700 hover:bg-gray-600 py-1 px-4 mt-2 text-sm font-semibold">View Event</button>
      </div>
    </div>
  );
};

export default EventCard;
